import React from "react";
import { Route, Router } from "react-router-dom";
import { Switch } from "react-router";
import { connect } from "react-redux";
import { withRouter } from "react-router";
import { bindActionCreators } from "redux";
import { createBrowserHistory } from "history";
import dashboard from "components/dashboard/Dashboard";
import EditPost from "components/dashboard/EditPost";
import Posts from "components/dashboard/Posts";
import Publications from "components/dashboard/Publications";
import Cds from "components/dashboard/Cds";
import MusicCatalogue from "components/dashboard/MusicCatalogue";
import Agendas from "components/dashboard/Agendas"
import Home from "components/Home"
import Post from "components/Post"
import Biography from "components/Biography"
import Music from "components/Music"
import Events from "components/Events"
import Order from "components/Order"
import News from "components/News"
import RentalCatalogue from "components/RentalCatalogue";
import AgendaList from "components/AgendaList"
import MusicProfile from "components/MusicProfile"
import CdProfile from "components/CdProfile"
import NewPost from "components/dashboard/NewPost"
import DashboardEvents from "components/dashboard/DashboardEvents"
import EditEvent from "components/dashboard/EditEvent"
import NewPublication from "components/dashboard/NewPublication"
import NewCd from "components/dashboard/NewCd"
import Submissions from "components/dashboard/Submissions";
import NewAgenda from "components/dashboard/NewAgenda";
import Login from "components/dashboard/Login"
const history = createBrowserHistory();
const SiteRouter = (props) => {
  console.log(props)

         return(
            <Router onUpdate={() => window.scrollTo(0, 0)} history={history}>
             <Switch>

                 <Route path="/dashboard/events/edit/:id" component={Object.values(props.user).length === 0 ? Login:EditEvent} />
                 <Route path="/dashboard/events" component={Object.values(props.user).length === 0 ? Login:DashboardEvents} />
                 <Route path="/dashboard/agenda/:id" component={Object.values(props.user).length === 0 ? Login:NewAgenda} />
                 <Route path="/dashboard/agenda/new" component={Object.values(props.user).length === 0 ? Login:NewAgenda} />
                 <Route path="/dashboard/agenda" component={Object.values(props.user).length === 0 ? Login:Agendas} />
                 <Route path="/dashboard/catalogue" component={Object.values(props.user).length === 0 ? Login:MusicCatalogue} />

                 <Route path="/dashboard/cds/edit/:id" component={Object.values(props.user).length === 0 ? Login:NewCd} />
                 <Route path="/dashboard/cds/new" component={Object.values(props.user).length === 0 ? Login:NewCd} />
                 <Route path="/dashboard/cds" component={Object.values(props.user).length === 0 ? Login:Cds} />

                 <Route path="/dashboard/publications/edit/:id" component={Object.values(props.user).length === 0 ? Login:NewPublication} />
                 <Route path="/dashboard/publications/new" component={Object.values(props.user).length === 0 ? Login:NewPublication} />
                 <Route path="/dashboard/publications" component={Object.values(props.user).length === 0 ? Login:Publications} />

                 <Route path="/dashboard/news/new" component={Object.values(props.user).length === 0 ? Login:NewPost} />
                 <Route path="/dashboard/news/edit/:id" component={Object.values(props.user).length === 0 ? Login:EditPost} />
                 <Route path="/dashboard/news" component={Object.values(props.user).length === 0 ? Login:Posts} />

                 <Route path="/dashboard/submissions" component={Submissions} />
                 <Route path="/dashboard/login" component={Login} />
                 <Route path="/dashboard/" component={dashboard} />

                 <Route path="/order" component={Order} />
                 <Route path="/rentalcatalogue" component={RentalCatalogue} />
                 <Route path="/biography" component={Biography} />
                 <Route path="/music/profile/:id" component={MusicProfile} />
                 <Route path="/music" component={Music} />
                 <Route path="/events" component={Events} />
                 <Route path="/post/:id" component={Post} />
                 <Route path="/agenda" component={AgendaList} />
                 <Route path="/news" component={News} history={history} />
                 <Route path="/cd/profile/:id" component={CdProfile} />
                 <Route path="/" component={Home} history={history} />
             </Switch>
            </Router>
         )

 }

const mapStateToProps = state => {
  return {
    user:state.userReducer
  };
};

const mapDispatchToProps = dispatch => {
  return {
    actions: bindActionCreators({}, dispatch)
  };
};

export default withRouter(
  connect(
    mapStateToProps,
    mapDispatchToProps
  )(SiteRouter)
)
